import { useState } from 'react';

function TodoList() {
  const [todos, setTodos] = useState([]);

  const addTodo = (todo) => {
    setTodos([...todos, todo]);
  };

  const removeTodo = (todo) => {
    setTodos(todos.filter(t => t !== todo));
  };

  return (
    <div>
      <h1>Todo List</h1>

      <TodoForm onSubmit={addTodo} />

      <ul>
        {todos.map(todo => (
          <Todo 
            key={todo} 
            todo={todo}
            onRemove={removeTodo} 
          />
        ))}
      </ul>
    </div>
  );
}

function TodoForm({ onSubmit }) {

  const [value, setValue] = useState('');

  const handleSubmit = e => {
    e.preventDefault();
    onSubmit(value);
    setValue('');
  }

  return (
    <form onSubmit={handleSubmit}>
      <input 
        type="text"
        value={value}
        onChange={e => setValue(e.target.value)} 
      />
      <button type="submit">Add Todo</button>
    </form>
  );
}

function Todo({ todo, onRemove }) {
  return (
    <li>
      {todo}
      <button onClick={() => onRemove(todo)}>Remove</button>
    </li>
  );
}

export default TodoList;
```

This allows users to add todos by submitting the form, and remove individual todos by clicking the remove button. The todos state is managed centrally in the parent TodoList component."]

